    func testParseOneResult() throws {
        guard let resultData = getOneResult().data(using: .utf8) else {
            XCTFail("We didn't get the results from the test file")
            return
        }
        do {
            let testResults = try JSONDecoder().decode(MotionCapture.self, from: resultData)
            XCTAssertNotNil(testResults, "We should have gotten a result")
            XCTAssertTrue(testResults.altitude == 1468.5676842071116, "The altitude should have been: \(1468.5676842071116)")
            XCTAssertTrue(testResults.roll == -0.0031066639523065626, "The roll should have been: \(-0.0031066639523065626)")
            XCTAssertTrue(testResults.pitch == -0.04002402922800594, "The pitch should have been: \(-0.04002402922800594)")
            XCTAssertTrue(testResults.yaw == -6.217894118042074e-05, "The yaw should have been: \(-6.217894118042074e-05)")
            XCTAssertTrue(testResults.timeStamp == 1700933756.185458, "The timeStamp should have been: \(1700933756.185458)")
            
        } catch let error {
            XCTFail("We didn't parse the results: \(error.localizedDescription)")
        }
    }
    
    func testParseAllResults() throws {
        guard let resultData = getResults().data(using: .utf8) else {
            XCTFail("We didn't get the results from the test file")
            return
        }
        do {
            let testResults = try JSONDecoder().decode(GroupResults.self, from: resultData)
            XCTAssertNotNil(testResults, "We should have gotten a result")
            XCTAssertEqual(testResults.theArray.count, 135, "There should be 135 records")
            
            let maxHeight = AircraftOrientationManager().findCriticalAngle(testResults.theArray, baseLine: nil)
            
        } catch let error {
            XCTFail("We didn't parse the results: \(error.localizedDescription)")
        }
    }
    
